import React, {Component} from 'react';
import '../App.css';


class Sidebar extends Component {
  state = {  }
  render() { 
    return (
      <div className="historyAndCollection">
      <button>
        History
      </button>
      <button>
        Collection
      </button>
      </div>
      );
  }
}
 
export default Sidebar;
